import React from 'react';
import { Route, Redirect } from 'react-router-dom'

const ProtectedRoute = ({ path, component: Component, ...rest}) => {
    return(
        <Route 
            path={path} 
            { ...rest}
            render={ props => {
                    return Component ? <Component {...props} /> : render(props);
                }     
            }
        />
    )
}

export default ProtectedRoute;
